message:
Gideão 

1. A finalidade da GLO nesse momento;
2. Cuidado com ensinamentos perigosos.

Vou perder minhas armas em 2023?

O que o governo ligado ao Foro de São Paulo tentará fazer este ano é:

➡️ Fim do porte de trânsito;

➡️ Retorno da comprovação de efetiva necessidade para porte ou posse de armas;

➡️ Devolução de "grosso calibre" adquirido pela população.

SE A INTERNET FOR SUSPENSA NO BRASIL A ORDEM É ESSA:

1 - IR PARA BRASÍLIA;
2 - QUEM NÃO FOR PARA BRASÍLIA SE MANTER NA PORTA DOS QUARTÉIS.
